(57, 'BOUTIQUE #12', 'Mẫu giao diện web bán hàng thời trang sáng tạo thân thiện người dùng và tương thích với tất cả các thiết bị di động và máy tính. Bạn có thể sử dụng với nhiều lĩnh vực Thời Trang khác nhau : Quần Áo Nam, Quần Áo Nữ, Trang Sức, Giầy Dép, Túi Xách ,.... ', 'Mẫu giao diện web bán hàng thời trang sáng tạo thân thiện người dùng và tương thích với tất cả các thiết bị di động và máy tính. Bạn có thể sử dụng với nhiều lĩnh vực Thời Trang khác nhau : Quần Áo Nam, Quần Áo Nữ, Trang Sức, Giầy Dép, Túi Xách ,.... ', 'Mẫu giao diện web bán hàng thời trang sáng tạo thân thiện người dùng và tương thích với tất cả các thiết bị di động và máy tính. Bạn có thể sử dụng với nhiều lĩnh vực Thời Trang khác nhau : Quần Áo Nam, Quần Áo Nữ, Trang Sức, Giầy Dép, Túi Xách ,.... ', '1587640535_38-avatar.jpg', '1587640535_38.jpg', '<p><span style=\"font-family:montserrat; font-size:14px\">Mẫu giao diện web bán hàng thời trang sáng tạo thân thiện người dùng và tương thích với tất cả các thiết bị di động và máy tính. Bạn có thể sử dụng với nhiều lĩnh vực Thời Trang khác nhau : Quần Áo Nam, Quần Áo Nữ, Trang Sức, Giầy Dép, Túi Xách ,.... </span></p>', 1587640535, 'Y', 2, 2, 6),
(58, 'Boyka #6', 'Boyka - Mẫu thương mại điện tử thời trang đơn giản và đáp ứng cho cửa hàng thời trang trực tuyến, chủ yếu tập trung vào giày dép và hàng da. Boyka được thiết kế thanh lịch, đảm bảo một không gian trực tuyến tuyệt vời để hiển thị các sản phẩm của bạn. Nếu ', 'Web bán hàng thời trang Boyka', 'Boyka - Mẫu thương mại điện tử thời trang đơn giản và đáp ứng cho cửa hàng thời trang trực tuyến, chủ yếu tập trung vào giày dép và hàng da. Boyka được thiết kế thanh lịch, đảm bảo một không gian trực tuyến tuyệt vời để hiển thị các sản phẩm của bạn. Nếu ', '1587640648_39-avatar.jpg', '1587640648_39.jpg', '<p><span style=\"font-family:montserrat; font-size:14px\">Boyka - Mẫu thương mại điện tử thời trang đơn giản và đáp ứng cho cửa hàng thời trang trực tuyến, chủ yếu tập trung vào giày dép và hàng da. Boyka được thiết kế thanh lịch, đảm bảo một không gian trực tuyến tuyệt vời để hiển thị các sản phẩm của bạn. Nếu bạn muốn tạo bất kỳ cửa hàng thương mại điện tử, trang web kinh doanh, blog hoặc danh mục đầu tư cá nhân, Boyka luôn là lựa chọn phù hợp cho cửa hàng trực tuyến của bạn.</span></p>', 1587640648, 'Y', 2, 2, 6),
(59, 'Ecolife', 'Ecolife la một thương hiệu chuyên về sản phẩm làm đẹp cho phái nữ. bao gồm các loại mỹ phẩm cao cấp được chiết xuất từ những nguyên liệu thiên nhiên tươi mát, cao cấp\r\nMỹ phẩm là một trong những công cụ hỗ trợ làm đẹp mà tất cả mọi người đều yêu thích, ng', 'Website bán mỹ phẩm', 'Ecolife la một thương hiệu chuyên về sản phẩm làm đẹp cho phái nữ. bao gồm các loại mỹ phẩm cao cấp được chiết xuất từ những nguyên liệu thiên nhiên tươi mát, cao cấp\r\nMỹ phẩm là một trong những công cụ hỗ trợ làm đẹp mà tất cả mọi người đều yêu thích, ng', '1587715412_1-avatar.jpg', '1587715412_1.jpg', '<p>Ecolife la một thương hiệu chuyên về sản phẩm làm đẹp cho phái nữ. bao gồm các loại mỹ phẩm cao cấp được chiết xuất từ những nguyên liệu thiên nhiên tươi mát, cao cấp<br />\r\nMỹ phẩm là một trong những công cụ hỗ trợ làm đẹp mà tất cả mọi người đều yêu thích, ngày nay với sự tiến bộ của ngành thẩm mỹ đã cho ra đời rất nhiều dòng sản phẩm khác nhau. Không thể phủ nhận công dụng và hiệu quả tuyệt vời mà mỹ phẩm mang lại trong quá trình làm đẹp, phòng ngừa và đặc trị cho tất cả chúng ta.<br />\r\nDùng mỹ phẩm làm đẹp tại nhà là nhu cầu cần thiết cho mỗi người, ai cũng muốn mình trẻ đẹp mãi mãi. Mỹ phẩm cần cho quá trình nuôi dưỡng, ngăn ngừa các tổn thương da từ bên ngoài và phục hồi lại làn da đã bị thương.</p>', 1587715412, 'Y', 2, 2, 11),
