(64, 'Ranna', 'Ranna - Thực phẩm & Công thức Blog WordPress Theme\r\nRanna là một chủ đề WordPress hiện đại và sạch đẹp cho blog thực phẩm và công thức nấu ăn. Chúng tôi đã bao gồm các tính năng và các yếu tố hàng đầu để cung cấp cho bạn trang web hoàn hảo để thể hiện niề', 'Website thực phẩm và chia sẻ công thức ', 'Ranna - Thực phẩm & Công thức Blog WordPress Theme\r\nRanna là một chủ đề WordPress hiện đại và sạch đẹp cho blog thực phẩm và công thức nấu ăn. Chúng tôi đã bao gồm các tính năng và các yếu tố hàng đầu để cung cấp cho bạn trang web hoàn hảo để thể hiện niề', '1587716487_6-avatar.jpg', '1587716487_6.jpg', '<h2>Ranna - Thực phẩm & Công thức Blog WordPress Theme</h2>\r\n\r\n<p>Ranna là một chủ đề WordPress hiện đại và sạch đẹp cho blog thực phẩm và công thức nấu ăn. Chúng tôi đã bao gồm các tính năng và các yếu tố hàng đầu để cung cấp cho bạn trang web hoàn hảo để thể hiện niềm đam mê của bạn đối với các món ăn ngon.</p>', 1587716487, 'Y', 2, 3, 2),
