(86, 'Ecolife #6', 'Ecolife la một thương hiệu chuyên về sản phẩm làm đẹp cho phái nữ. bao gồm các loại mỹ phẩm cao cấp được chiết xuất từ những nguyên liệu thiên nhiên tươi mát, cao cấp  ', '                                                                        Website bán mỹ phẩm                                                                        ', '                                                                        Ecolife la một thương hiệu chuyên về sản phẩm làm đẹp cho phái nữ. bao gồm các loại mỹ phẩm cao cấp được chiết xuất từ những nguyên liệu thiên nhiên tươi mát, cao cấp  \r\n\r\nMỹ phẩm là ', '1587736303_28-avatar.jpg', '1587737272_29-avatar.jpg', '<p>Ecolife la một thương hiệu chuyên về sản phẩm làm đẹp cho phái nữ. bao gồm các loại mỹ phẩm cao cấp được chiết xuất từ những nguyên liệu thiên nhiên tươi mát, cao cấp  </p>\r\n\r\n<p>Mỹ phẩm là một trong những công cụ hỗ trợ làm đẹp mà tất cả mọi người đều yêu thích, ngày nay với sự tiến bộ của ngành thẩm mỹ đã cho ra đời rất nhiều dòng sản phẩm khác nhau. Không thể phủ nhận công dụng và hiệu quả tuyệt vời mà mỹ phẩm mang lại trong quá trình làm đẹp, phòng ngừa và đặc trị cho tất cả chúng ta<br />\r\nDùng mỹ phẩm làm đẹp tại nhà là nhu cầu cần thiết cho mỗi người, ai cũng muốn mình t.rẻ đẹp mãi mãi. Mỹ phẩm cần cho quá trình nuôi dưỡng, ngăn ngừa các tổn thương da từ bên ngoài và phục hồi lại làn da đã bị thương.</p>', 1587736303, 'Y', 2, 2, 11),
