(94, 'Superfood #3', 'Website giới thiệu và bán các loại kem . đầy đủ hương bị từ trái cây tự nhiên tươi mát.', 'Website bán kem, chia sẻ công thức chế biến', 'Website giới thiệu và bán các loại kem . đầy đủ hương bị từ trái cây tự nhiên tươi mát.', '1587811933_37-avatar.jpg', '1587811933_37.jpg', '<p>Website giới thiệu và bán các loại kem . đầy đủ hương bị từ trái cây tự nhiên tươi mát.</p>\r\n\r\n<p>Mùa hè sắp tới. không khí nóng bức, chuẩn bị bao vây chúng ta. thì chúng ta phải làm gì?</p>\r\n\r\n<p>Tìm tới nhưng viên kem, que kem thơm mát từ tất cả các mùi vị trái cây, nguyên liệu tự nhiên tươi mát sẽ giúp cho chúng ta đánh bay được sự nóng bức, mệt mỏi trong người để có đầy đủ năng lượng thực hiện những mục tiêu của mình</p>', 1587811933, 'Y', 2, 2, 19),
(95, 'Superfood #4', 'Website chúng tôi cung cấp cho mọi người những hiểu biết và những thực phẩm sạch ', 'Website giới thiệu, cung cấp thực phẩm sạch', 'Website chúng tôi cung cấp cho mọi người những hiểu biết và những thực phẩm sạch ', '1587812296_38-avatar.jpg', '1587812296_38.jpg', '<p>Website chúng tôi cung cấp cho mọi người những hiểu biết và những thực phẩm sạch. </p>\r\n\r\n<p>Sức khỏe là 1 phần thiết yếu trong cuộc sống mà ai ai trong mỗi chúng ta đều phải chăm sóc. vì vậy muốn sức khỏe thật tốt thì bạn phải ăn uống, ngủ đúng giờ giấc. </p>\r\n\r\n<p>Đặc biệt là phải cung cấp nhìu chất xơ và phải đảm bảo những thứ chung ta ăn vô đều phải có nguồn gốc và sạch sẽ. </p>\r\n\r\n<p>Nên chung tối ở đây để hỗ trợ cho bạn làm điều đó. </p>', 1587812296, 'Y', 2, 2, 13),
(96, 'Superfood #5', 'Website chúng tôi hỗ trợ cho bạn về cách chăm sóc sắc đẹp.', '                                    Website Về mỹ phẩm, làm đẹp                                    ', '                                    Website chúng tôi hỗ trợ cho bạn về cách chăm sóc sắc đẹp.                                    ', '1587812773_39-avatar.jpg', '1587813850_39-avatar.jpg', '<p>Website chúng tôi hỗ trợ cho bạn về cách chăm sóc sắc đẹp.</p>\r\n\r\n<p>Chúng tôi luôn cập nhật và mang đến cho phái đẹp nhưng sự lựa chọn hàng đầu, để khi bạn nhắc tới vấn đề về sắc đẹp thì các bạn sẽ nhớ ngay đến chúng tôi. vì chúng tôi luôn mang đến điều tuyệt vời nhất cho bạn. </p>\r\n\r\n<p>Sắc đẹp là 1 trong số những điều mà chúng ta quan tâm nhất. chung tôi luôn chuẩn bị và chế biến từ những nguyên liệu thượng hàng và có nguồn gốc rõ ràng. sẽ làm cho bạn hài lòng khi cho chung tôi được phục vụ bạn</p>', 1587812773, 'Y', 2, 2, 11),
(97, 'Superfood #6', 'Website chung tối cung cấp các công thức và sản phẩm về những món đồ uống cho các tín đồ đam mê coffee. ', '                                    Website về coffe                                    ', '                                    Website chung tối cung cấp các công thức và sản phẩm về những món đồ uống cho các tín đồ đam mê coffee.                                     ', '1587813262_40-avatar.jpg', '1587813834_40-avatar.jpg', '<p>Website chung tối cung cấp các công thức và sản phẩm về những món đồ uống cho các tín đồ đam mê coffee. </p>\r\n\r\n<p>Chúng tôi mang tới nhưng món thức uống thượng hàng bằng những công thức tuyệt vời nhất. để giúp cho bạn có được tinh thần thoải mải để làm việc.</p>\r\n\r\n<p>Dòng coffee của chúng tôi được thực hiện bởi nhưng tay nghề pha chế chuyên nghiệp để mang tới sản phẩm tốt nhất cho bạn.</p>', 1587813262, 'Y', 2, 2, 20),
(98, 'Superfood #7', 'Nơi chia sẻ công thức và bán các loại thức ăn nhanh  nhanh, bánh ngọt ', '                                    Website Chia sẻ công thức và bán bánh ngọt                                    ', '                                    Nơi chia sẻ công thức và bán các loại thức ăn nhanh  nhanh, bánh ngọt                                    ', '1587813710_41-avatar.jpg', '1587813823_41-avatar.jpg', '<p>Nơi chia sẻ công thức và bán các loại thức ăn nhanh  nhanh, bánh ngọt. luôn luôn cập nhật những món bánh lạ với nhiều công thức khác nhau để mang tới cho khách hàng được thưởng thức nhìu vị mà không chán. mỗi loại bánh chung tôi chế biến ra nó đều có hương vị riêng. mang tới cho khách hàng 1 bữa an ngon miệng</p>\r\n\r\n<p> </p>', 1587813710, 'Y', 2, 2, 14),
(99, 'Superfood #8', 'Chuyên về thực phẩm hữu cơ, sản phẩm sức khỏe tự nhiên, blog thực phẩm, sản phẩm y tế tự nhiên, cho bất kỳ tiệm bánh, nhà hàng, cửa hàng kem, cửa hàng cà phê, cửa hàng tạp hóa, tên bạn.', '                                    Website Bán Trà                                    ', '                                    Chuyên về thực phẩm hữu cơ, sản phẩm sức khỏe tự nhiên, blog thực phẩm, sản phẩm y tế tự nhiên, cho bất kỳ tiệm bánh, nhà hàng, cửa hàng kem, cửa hàng cà phê, cửa hàng tạp hóa, tên bạn.                                  ', '1587814210_42-avatar.jpg', '1587814240_42-avatar.jpg', '<p>Nếu bạn đang tìm kiếm một chủ đề phù hợp nhất cho việc kinh doanh thực phẩm của mình, thì đừng tìm đâu xa - Superfood là lựa chọn tốt nhất của bạn! Chủ đề đáng kinh ngạc này là tuyệt vời cho tất cả các loại trang web: thực phẩm hữu cơ, sản phẩm sức khỏe tự nhiên, blog thực phẩm, sản phẩm y tế tự nhiên, cho bất kỳ tiệm bánh, nhà hàng, cửa hàng kem, cửa hàng cà phê, cửa hàng tạp hóa, tên bạn, Superfood đã bao gồm ! Nó đi kèm với một loạt các trang chủ được thiết kế sẵn và các yếu tố mới có thể được sử dụng để giới thiệu doanh nghiệp của bạn trong ánh sáng tốt nhất. Nếu bạn thích đồ ăn tốt cho sức khỏe, ngành công nghiệp mỹ phẩm hay các sản phẩm tốt cho sức khỏe nói chung, thì Superfood chỉ là chủ đề dành cho bạn. Nhờ có nhiều mẫu cửa hàng, bạn có thể dễ dàng tạo ra một cửa hàng thực phẩm trực tuyến và trưng bày các sản phẩm thực phẩm, cửa hàng tạp hóa và tất cả các loại sản phẩm tự nhiên.</p>', 1587814210, 'Y', 2, 2, 21),
