(123, 'Trax', 'Trax - One Page + Multipage Parallax là một mẫu phản hồi HTML5 phù hợp cho bất kỳ doanh nghiệp hoặc doanh nghiệp khởi nghiệp. Nó được xây dựng bằng khung Bootstrap4. Hơn 45 mẫu bao gồm các trang blog và cửa hàng độc lập cũng được bao gồm trong mẫu này với', 'Website chia sẻ phần mềm', 'Trax - One Page + Multipage Parallax là một mẫu phản hồi HTML5 phù hợp cho bất kỳ doanh nghiệp hoặc doanh nghiệp khởi nghiệp. Nó được xây dựng bằng khung Bootstrap4. Hơn 45 mẫu bao gồm các trang blog và cửa hàng độc lập cũng được bao gồm trong mẫu này với', '1588305670_4-avatar.jpg', '1588305670_4.jpg', '<p>Trax - One Page + Multipage Parallax là một mẫu phản hồi HTML5 phù hợp cho bất kỳ doanh nghiệp hoặc doanh nghiệp khởi nghiệp. Nó được xây dựng bằng khung Bootstrap4. Hơn 45 mẫu bao gồm các trang blog và cửa hàng độc lập cũng được bao gồm trong mẫu này với rất nhiều hình ảnh động CSS và JQuery, một mẫu hoàn hảo cho các doanh nghiệp khởi nghiệp, studio web và các cơ quan kỹ thuật số. Các phần thông tin tiêu chuẩn sẽ giúp bất cứ ai tùy chỉnh theo thông tin công ty của họ. Mẫu này được nhận xét rất tốt và cũng có tài liệu trợ giúp thích hợp quá.</p>', 1588305670, 'Y', 2, 1, 26),
